    const yearsToBeCalced = [];
    const firstYear = -1;
    const firstYearCalcable = -1;
    const lastYearCalcable = -1;
    const kgvPerYear = {};
    const divRenPerYear = {};
    const divPerYear = {};
    const incomePerYear = {};
    const fairValueIncomeName = "Fair Value bil. Gewinn";
    const fairValueDivdendName = "Fair Value Dividende";

    // eslint-disable-next-line no-unused-vars
    const chart = ref({});

    return {
      fvData,
      fairValuesPerYear,
      fairValueCalcTime,
      fairDivRenPerYear,
      yearsToBeCalced,
      firstYear,
      firstYearCalcable,
      lastYearCalcable,
      kgvPerYear,
      divRenPerYear,
      divPerYear,
      incomePerYear,
      fairValueIncomeName,
      fairValueDivdendName,
    };
  },
  mounted() {
    this.initialSetup();
    this.calcFairValues();
    this.regenChartOption();
  },
  watch: {
    fairValueCalcTime() {
      this.calcFairValues();
      this.regenChartOption();
    },
  },
  methods: {
    initialSetup() {
      this.firstYear = this.getFirstYear();
      this.firstYearCalcable = this.getFirstYearCalcable(this.firstYear);
      this.lastYearCalcable = this.getLastYearCalcable();
      this.kgvPerYear = {};
      this.divRenPerYear = {};
      this.fvData.forEach((x) => {
        this.kgvPerYear[x.year] = this.calcKGVForYear(x);
        this.divRenPerYear[x.year] = this.calcDivRenPerYear(x);
        this.divPerYear[x.year] = x.dividend;
        this.incomePerYear[x.year] = x.bilIcomePS;
      });
      console.log(this.lastYearCalcable);
    },
    changeFairValueCalcTime(newCalcTime) {
      this.fairDivRenPerYear = {};
      this.fairValuesPerYear = {};
      this.yearsToBeCalced = [];
      this.fairValueCalcTime = newCalcTime;
    },
    getFirstYear() {
      return this.fvData[0].year;
    },
    getFirstYearCalcable(firstYear) {
      return firstYear + this.fairValueCalcTime;
    },
    getLastYearCalcable() {
      return this.fvData[this.fvData.length - 1].year;
    },
    calcKGVForYear(aktData) {
      let priceLength = aktData.prices.length;
      let avgPrice = 0;
      aktData.prices.forEach((x) => (avgPrice += x.priceHigh));
      avgPrice = avgPrice / priceLength;
      return this.calcKGV(aktData.bilIcomePS, avgPrice);
    },
    calcDivRenPerYear(aktData) {
      let priceLength = aktData.prices.length;
      let avgPrice = 0;
      aktData.prices.forEach((x) => (avgPrice += x.priceHigh));
      avgPrice = avgPrice / priceLength;
      return aktData.dividend / avgPrice;
    },
    calcDivFairValue(averagDividend, yearToCalc) {
      this.fairDivRenPerYear[yearToCalc] =
        this.divPerYear[yearToCalc - 1] / averagDividend;
    },
    prepareKgvInAccountAndAvgDiv(
      kgvsInAccount,
      divRenPerYear,
      kgvPerYear,
      yearToCalc
    ) {
      let avgDiv = 0;
      for (let j = yearToCalc - this.fairValueCalcTime; j < yearToCalc; j++) {
        avgDiv += divRenPerYear[j];
        kgvsInAccount.push(kgvPerYear[j]);
      }
      return avgDiv / this.fairValueCalcTime;
    },
    filterKgvs(kgvsInAccount) {
      kgvsInAccount.sort((a, b) => a - b);
      let median = this.calcMediaOfSorted(kgvsInAccount);
      let standardDeviation = this.getStandardDeviation(kgvsInAccount, median);
      return kgvsInAccount.filter(
        (x) =>
          x > median - standardDeviation * 3 ||
          x < median + standardDeviation * 3
      );
    },
    calcKGVFairValue(kgvsInAccount, yearToCalc) {
      let avg = kgvsInAccount.reduce((a, b) => a + b, 0) / kgvsInAccount.length;
      this.fairValuesPerYear[yearToCalc] =
        avg * this.incomePerYear[yearToCalc - 1];
    },
    calcFairValues() {
      this.firstYearCalcable = this.getFirstYearCalcable(this.firstYear);
      for (
        let yearToCalc = this.firstYearCalcable;
        yearToCalc <= this.lastYearCalcable;
        yearToCalc++
      ) {
        let kgvsInAccount = [];
        let avgDiv = 0;
        this.yearsToBeCalced.push(yearToCalc);

        avgDiv = this.prepareKgvInAccountAndAvgDiv(
          kgvsInAccount,
          this.divRenPerYear,
          this.kgvPerYear,
          yearToCalc
        );
        this.calcDivFairValue(avgDiv, yearToCalc);
        this.calcKGVFairValue(kgvsInAccount, yearToCalc);
        kgvsInAccount = [];
      }
    },
    calcKGVHighLow(income, priceLow, priceHigh) {
      return (priceLow + priceHigh) / 2 / income;
    },
    calcKGV(income, price) {
      return price / income;
    },
    calcAvgPrice(prices) {
      let sum = 0;
      prices.forEach((x) => {
        sum += x.priceLow;
        sum += x.priceHigh;
      });
      return sum / (prices.length * 2);
    },
    calcMediaOfSorted(values) {
      let middle = Math.floor(values.length / 2);
      if (values % 2) {
        return values[middle];
      } else {
        return (values[middle - 1] + values[middle]) / 2.0;
      }
    },
    getStandardDeviation(values, mean) {
      let n = values.length;
      return Math.sqrt(
        values.map((x) => Math.pow(x - mean, 2)).reduce((a, b) => a + b) / n
      );
    },
    regenChartOption() {
      var color = "currentColor";
      var fvIcome = [];
      var stockData = [];
      var income = [];
      var fvDiv = [];
      var dividend = [];
      console.log(this.yearsToBeCalced);
      this.yearsToBeCalced.forEach((x) => {
        fvIcome.push([
          new Date(parseInt(x), 9, 26, 5).getTime(),
          this.fairValuesPerYear[x],
        ]);
        fvDiv.push([
          new Date(parseInt(x), 11, 31, 5).getTime(),
          this.fairDivRenPerYear[x],
        ]);
      });
      //TODO find highest date for up to date data
      this.fvData.forEach((x) => {
        x.prices.forEach((y) => {
          stockData.push([
            new Date(x.year, y.month - 1, y.day, 5).getTime(),
            y.priceClose,
          ]);
        });
        income.push([new Date(x.year, 11, 31, 5).getTime(), x.bilIcomePS]);
        dividend.push([new Date(x.year, 11, 31, 5).getTime(), x.dividend]);
      });
      var series = [
        {
          name: "Gewinn",
          data: income,
          type: "line",
        },

        {
          name: "Dividende",
          data: dividend,
          type: "line",
        },
        {
          name: this.fairValueIncomeName,
          data: fvIcome,
          type: "column",
        },
        {
          name: this.fairValueDivdendName,
          data: fvDiv,
          type: "column",
        },
        {
          name: "Kurs",
          data: stockData,
          type: "area",
        },
      ];
      var chartOptions = {
        chart: {
          animations: {
            enabled: false,
          },
          type: "line",
          width: "100%",
          height: "500px",
          toolbar: {
            show: true,
            tools: {
              download: false,
              selection: false,
              zoom: false,
              zoomin: false,
              zoomout: false,
              pan: false,
              reset: false,
              customIcons: [],
            },
          },
        },
        fill: {
          opacity: [1, 1, 1, 1, 0.1],
          type: ["solid", "solid", "solid", "solid", "gradient"],
          gradient: {
            shadeIntensity: 0,
            opacityFrom: 0.5,
            opacityTo: 0.1,
            type: "vertical",
            stops: [0, 100],
          },
        },
        colors: ["#8294dc", "#eb8693", "#3d5bce", "#e24158", "#67a3ff"],
        legend: {
          show: true,
          showForSingleSeries: true,
          labels: {
            colors: color,
          },
          position: "top",
          horizontalAlign: "left",
          markers: {
            radius: 0,
          },
        },
        series: series,
        tooltip: {
          enabled: true,
          shared: true,
          x: {
            show: false,
          },
          custom: ({ series, seriesIndex, dataPointIndex, w }) => {
            const hoverXaxis = w.globals.seriesX[seriesIndex][dataPointIndex];
            let hoverIndexes = w.globals.seriesX.map((seriesX) => {
              return seriesX.findIndex((xData) => xData === hoverXaxis);
            });

            //fixes the hover indexes for the chart bar 'hack'
            //tries to display the tooltip as much as possible
            let newHoverXAxis = hoverXaxis;
            let incomeIndex = w.globals.seriesNames.findIndex(
              (x) => x === this.fairValueIncomeName
            );
            let divIndex = w.globals.seriesNames.findIndex(
              (x) => x === this.fairValueDivdendName
            );

            if (
              hoverIndexes[incomeIndex] == -1 &&
              hoverIndexes[divIndex] != -1
            ) {
              hoverIndexes[incomeIndex] = hoverIndexes[divIndex];
              newHoverXAxis =
                w.globals.seriesX[divIndex][hoverIndexes[divIndex]];
            } else if (
              hoverIndexes[incomeIndex] != -1 &&
              hoverIndexes[divIndex] == -1
            ) {
              hoverIndexes[divIndex] = hoverIndexes[incomeIndex];
            }
            newHoverXAxis = w.globals.seriesX[divIndex][hoverIndexes[divIndex]];
            if (newHoverXAxis == -1 || newHoverXAxis == undefined) {
              newHoverXAxis = hoverXaxis;
            }
            hoverIndexes = hoverIndexes.map((x, i) => {
              let newIndex = w.globals.seriesX[i].findIndex(
                (xData) => xData == newHoverXAxis
              );
              if (newIndex == -1) {
                newIndex = w.globals.seriesX[i].findIndex(
                  (xData) =>
                    xData > newHoverXAxis &&
                    new Date(xData).getFullYear() ==
                      new Date(newHoverXAxis).getFullYear()
                );
              }
              if (newIndex == -1) {
                var index = w.globals.seriesX[i].length - 1;
                for (; index >= 0; index--) {
                  if (
                    w.globals.seriesX[i] < newHoverXAxis &&
                    new Date(w.globals.seriesX[i]).getFullYear() ==
                      new Date(newHoverXAxis).getFullYear()
                  ) {
                    newIndex = w.globals.seriesX[i];
                    break;
                  }
                }
              }
              if (newIndex != -1) {
                return newIndex;
              } else {
                return x;
              }
            });
            let hoverList = "";
            if (newHoverXAxis > Date.now()) {
              newHoverXAxis = Date.now();
            }
            //let newHoverDate = new Date(newHoverXAxis);
            let orginalHoverDate = new Date(hoverXaxis);
            hoverIndexes.forEach((hoverIndex, seriesEachIndex) => {
              if (hoverIndex >= 0) {
                hoverList += `<div class="apexcharts-tooltip-series-group apexcharts-active" style="order: ${
                  hoverIndex + 1
                }; display: flex;">`;
                hoverList += `  <span class="apexcharts-tooltip-marker" style="background-color: ${w.globals.colors[seriesEachIndex]};"></span>`;
                hoverList += `  <div class="apexcharts-tooltip-text" style="font-family: Helvetica, Arial, sans-serif; font-size: 12px;">`;
                hoverList += `    <div class="apexcharts-tooltip-y-group">`;
                hoverList += `     <span class="apexcharts-tooltip-text-y-label">${w.globals.seriesNames[seriesEachIndex]}: </span>`;
                if (w.globals.seriesNames[seriesEachIndex] != "Kurs") {
                  hoverList += `      <span class="apexcharts-tooltip-text-y-value">${series[
                    seriesEachIndex
                  ][hoverIndex].toFixed(
                    2
                  )}&nbsp;$ (${orginalHoverDate.getFullYear()})</span>`;
                } else {
                  hoverList += `      <span class="apexcharts-tooltip-text-y-value">${series[
                    seriesEachIndex
                  ][hoverIndex].toFixed(2)}&nbsp;$</span>`;
                }
                hoverList += `    </div>`;
                hoverList += `    <div class="apexcharts-tooltip-goals-group">
                                    <span class="apexcharts-tooltip-text-goals-label"></span>
                                    <span class="apexcharts-tooltip-text-goals-value"></span>
                                  </div>
                                  <div class="apexcharts-tooltip-z-group">
                                    <span class="apexcharts-tooltip-text-z-label"></span>
                                    <span class="apexcharts-tooltip-text-z-value"></span>
                                  </div>
                              </div>
                            </div>
                            `;
              }
            });

            const formatHoverX =
              orginalHoverDate.getDate() +
              "." +
              (orginalHoverDate.getMonth() + 1) +
              "." +
              orginalHoverDate.getFullYear();
            return `
                      <div class="apexcharts-tooltip-title" style="font-family: Helvetica, Arial, sans-serif; font-size: 12px;">${formatHoverX}</div>
                      ${hoverList}`;
          },
        },
        dataLabels: {
          enabled: false,
        },
        stroke: {
          width: [2, 2, 3, 3, 1.5],
          curve: "smooth",
        },
        plotOptions: {
          bar: {
            columnWidth: "50%",
            horizontal: false,
          },
        },
        yaxis: [
          {
            seriesName: "Gewinn",
            opposite: true,
            labels: {
              style: {
                colors: color,
              },
              formatter: (value) => {
                return new Intl.NumberFormat("de-DE", {
                  style: "currency",
                  currency: "USD",
                }).format(value);
              },
            },
          },
          {
            seriesName: "Gewinn",
            show: false,
            labels: {
              style: {
                colors: color,
              },
              formatter: (value) => {
                return new Intl.NumberFormat("de-DE", {
                  style: "currency",
                  currency: "USD",
                }).format(value);
              },
            },
          },
          {
            seriesName: "Fair Value bil. Gewinn",

            labels: {
              style: {
                colors: color,
              },
              formatter: (value) => {
                return new Intl.NumberFormat("de-DE", {
                  style: "currency",
                  currency: "USD",
                }).format(value);
              },
            },
          },
          {
            seriesName: "Fair Value bil. Gewinn",
            show: false,
            labels: {
              style: {
                colors: color,
              },
              formatter: (value) => {
                return new Intl.NumberFormat("de-DE", {
                  style: "currency",
                  currency: "USD",
                }).format(value);
              },
            },
          },
          {
            seriesName: "Fair Value bil. Gewinn",
            show: false,
            labels: {
              style: {
                colors: color,
              },
              formatter: (value) => {
                return new Intl.NumberFormat("de-DE", {
                  style: "currency",
                  currency: "USD",
                }).format(value);
              },
            },
          },
        ],
        xaxis: {
          type: "datetime",
          tickPlacement: "between",
          labels: {
            style: {
              colors: color,
            },
          },
        },
      };
      if (!this.chart) {
        this.chart = new ApexCharts(
          document.querySelector("#chartplh"),
          chartOptions
        );
        this.chart.render();
      } else {
        this.chart.updateSeries(series);
      }
    },
  },
};
</script>